import EntryForm from './EntryForm';
import { Link } from 'react-router-dom';

function Register() {
  return (
    <EntryForm name="register" title="Регистрация" buttonText="Зарегистрироваться">
      <p className="entry__caption">Уже зарегистрированы? <Link to="/sign-in">Войти</Link></p>
    </EntryForm>
  );
}
export default Register;
